import { useState } from "react";
import Main from "./Main";

const Homes = () => {
  const [name, setName] = useState("mario");
  const [age, setAge] = useState(25);

  function changeName() {
    setName("furkan");
    setAge(30);
  }

  return (
    <div className="home">
      <Main />

      <p>
        {name} is {age} old
      </p>
      <button onClick={changeName}>click me</button>
    </div>
  );
};

export default Homes;
